import dids from "../../data/dids.json"

const getDidData = () => {
  let i = 0;
  let searchDid = [];

  dids['dids'].forEach(did => {
    searchDid.push([
      {
        key: i,
        type: "did",
        index: "DID",
        data: did['did']
      },
      {
        key: i,
        type: "line",
        index: "Primary Line",
        data: did['line']
      },
      {
        key: i,
        type: "location",
        index: "Location",
        data: did['location']
      },
      {
        key: i,
        type: "area",
        index: "Area",
        data: did['area']
      },
      {
        key: i,
        type: "description",
        index: "Description",
        data: did['description']
      },
      {
        key: i,
        type: "",
        data: ""
      },
    ])
  })

  return searchDid
}

export default getDidData();
